import Layout from "../components/MyLayout";
import { useRouter } from "next/router";

export default function Index() {
  return (
    <Layout page="Home">
      <h1>Software / Web Developer</h1>
      <p>Currently Based in San Diego, CA.</p>
      <style jsx>{`
        h1 {
          position: absolute;
          top: 45%;
          right: 50%;
          text-align: center;
        }
      `}</style>
    </Layout>
  );
}
